package com.bomu.game.handler;

import com.alibaba.fastjson.JSONObject;
import com.bomu.game.service.TableService;
import com.bomu.game.socket.annotation.Direct;
import com.bomu.game.socket.annotation.WebSocketAction;
import com.bomu.game.socket.handler.Action;
import com.bomu.game.socket.protobuf.webSocket.WebSocket;
import com.bomu.socket.protocol.MetaData;
import com.bomu.socket.protocol.Protocol;
import com.bomu.socket.protocol.ResponseData;
import org.springframework.beans.factory.annotation.Autowired;

@WebSocketAction(module = Constants.GAME_MODULE)
public class HandlerAction extends Action {
    @Autowired
    private TableService tableService;

    @Direct(value = Command.HEART)
    public void heart(WebSocket webSocket, MetaData meta, JSONObject data) {
        webSocket.send(new Protocol(meta, ResponseData.ok()));
    }

    @Direct(value = Command.TEST)
    public void test(WebSocket webSocket, MetaData meta, JSONObject data) {
        System.out.println("收到客户端消息: " + data.toJSONString());

//        String otherData = "";

        ResponseData respData = new ResponseData();
        respData.put("otherData", "你好啊");

        webSocket.send(new Protocol(meta, respData));
    }
}
